--
-- Create procedure `Proc_employee_DuplicateCode`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_employee_DuplicateCode (IN v_employeeCode char(20), IN v_employeeId char(36))
BEGIN

  -- Author:        DXLOC
  -- Created date:  15/9/2022
  -- Description:   Lấy ra nhân viên theo mã code ( Check trùng mã )
  -- Modified by:
  -- Code chạy thử: CALL Proc_employee_DuplicateCode()
  IF v_employeeId IS NULL THEN
    SELECT
      *
    FROM employee
    WHERE EmployeeCode = v_employeeCode;
  ELSE
    SELECT
      *
    FROM employee
    WHERE EmployeeCode = v_employeeCode
    AND EmployeeID != v_employeeId;
  END IF;
END
$$

