--
-- Create procedure `Proc_employee_Filter`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_employee_Filter (IN v_pagenumber tinyint, -- Trang thứ bao nhiêu
IN v_pagesize tinyint, -- Số bản ghi trên 1 trang
IN v_search varchar(250))
BEGIN
  -- Author:        DXLOC
  -- Created date:  15/9/2022
  -- Description:   Lấy danh sách nhân viên và tổng số nhân viên có phân trang , tìm kiếm, sắp xếp
  -- Modified by:
  -- Code chạy thử: CALL Proc_employee_Filter(1, 10 , 'loc');
  SET @order = ' ORDER BY ModifiedDate DESC';

  IF IFNULL(v_search, '') = '' THEN
    SET @filterWhere = '1=1';
  ELSE
    SET @filterWhere = CONCAT(' EmployeeCode LIKE ''%', v_search, '%'' OR FullName LIKE ''%', v_search, '%'' OR Email LIKE ''%', v_search, '%''');
  END IF;

  -- điều kiện nếu ko có bản ghi (limit)
  IF v_pagesize = -1 THEN
    SET @filterQuery = CONCAT('SELECT e.EmployeeID, e.EmployeeCode, e.FullName, 
    e.Gender,e.DateOfBirth, e.IdentityNumber,e.IdentityDate, 
    e.IdentityPlace, e.PositionName, e.DepartmentName,e.PositionID, e.DepartmentID,
    e.BankAccountNumber, e.BankAccountName, e.BankBranch, e.Address
    FROM employee e WHERE ', @filterWhere, @order);
  ELSE
    SET @offset = (v_pagenumber * v_pagesize) - v_pagesize;
    SET @filterQuery = CONCAT('SELECT e.EmployeeID, e.EmployeeCode, e.FullName, 
    e.Gender , e.DateOfBirth, e.IdentityNumber,e.IdentityDate, 
    e.IdentityPlace, e.PositionName, e.DepartmentName,e.PositionID, e.DepartmentID,
    e.BankAccountNumber, e.BankAccountName,e.BankBranch, e.Address
    FROM employee e WHERE ', @filterWhere, @order, ' LIMIT ', v_pagesize, ' OFFSET ', @offset);
  END IF;

  -- Lấy ra tổng số bản ghi theo điều kiện lọc
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;

  -- Lấy ra tổng số bản ghi theo điều kiện lọc
  SET @filterQuery = CONCAT('SELECT count(EmployeeID) AS TotalCount FROM employee WHERE ', @filterWhere, @order);
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;
END
$$

